    @RequestMapping(value = "/login",method = RequestMethod.POST)
    @ResponseBody
    public JSONObject login(String username, String password,boolean rememberMe, HttpServletRequest request,
                        String verifyCode,Model model){
        JSONObject json = new JSONObject();
        //用户名和密码的获取
        UsernamePasswordToken token = new UsernamePasswordToken(username,password);
        Subject currentUser = SecurityUtils.getSubject();
        if (!CaptchaUtil.ver(verifyCode, request)) {
            CaptchaUtil.clear(request);  // 清除session中的验证码
            json.put("flag",false);
            json.put("msg","验证码不正确!");
            return json;
        }

        //主体提交登录请求到SecurityManager
        try {
            token.setRememberMe(rememberMe);
            currentUser.login(token);
        }catch (IncorrectCredentialsException ice){
            json.put("msg","密码不正确!");
        }catch(UnknownAccountException uae){
            json.put("msg","账号不存在!");
        }catch(AuthenticationException ae){
            json.put("msg","状态不正常!");
        }
        //通过查看authenticated 的状态判断验证是否通过，通过时（没有抛出任何异常）返回true
        //没有通过或者在Realm 中抛出异常，返回false
        if(currentUser.isAuthenticated()){
            System.out.println("认证成功");
            model.addAttribute("username",username);
            //查询不同用户的权限
            String [] adminThings = {"yonghu","juese","shenpi"};
            String [] empThings = {"yonghu"};
            if(currentUser.hasRole("admin")){
                 if(currentUser.isPermittedAll(adminThings)){
                     model.addAttribute("things",adminThings);
                 }
            }else if(currentUser.hasRole("employment")){
                if(currentUser.isPermittedAll(empThings)){
                    model.addAttribute("things",empThings);
                }
            }
            json.put("flag",true);
            return json;
        }else{
            json.put("flag",false);
            //清空设置的用户名和密码
            token.clear();
            return json;
        }
    }

