    @RequestMapping("/showPdf2")
    public void showPdf2(HttpServletResponse response,HttpServletRequest request) throws IOException {
        //跨域请求
        String s0 = "D:test.pdf";
        response.setHeader("Access-Control-Allow-Origin", "*");
        File file = new File("D:\\aaa\\test.pdf");
        response.setContentLength((int) file.length());
        response.setHeader( "Content-Disposition", "attachment;filename=" + URLEncoder.encode(file.getName(), "UTF-8"));// 设置在下载框默认显示的文件名
        response.setContentType("application/octet-stream");// 指明response的返回对象是文件流
// 读出文件到response
// 这里是先需要把要把文件内容先读到缓冲区
// 再把缓冲区的内容写到response的输出流供用户下载
        FileInputStream fileInputStream = new FileInputStream(file);
        BufferedInputStream bufferedInputStream = new BufferedInputStream(fileInputStream);
        OutputStream outputStream = response.getOutputStream();
        byte buffer[] = new byte[1024];
        int len = 0;
        while ((len = bufferedInputStream.read(buffer)) > 0) {
            outputStream.write(buffer, 0, len);
        }
        // 人走带门
        bufferedInputStream.close();
        outputStream.flush();
        outputStream.close();
    }

